import React from 'react';

const Checkbox = ({identifier, status, onClick, selectAll, allSelected}) => {
return (
<input name="checkbox" type="checkbox" onChange={(id) => {onClick(identifier)||selectAll(identifier)}} checked={status || allSelected} />
)
}

export default Checkbox;
